package com.sajansthapit.mytodolist.models;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;import lombok.*;import java.util.Objects;@Getter@Setter@Entity@Builder@NoArgsConstructor@AllArgsConstructor@Table(name = "priority")public class Priority extends BaseModel {    @Id    private String id;    @Column(name = "name", unique = true, nullable = false)    private String name;    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof Priority priority)) return false;        if (!super.equals(o)) return false;        return Objects.equals(id, priority.id) && Objects.equals(name, priority.name);    }    @Override    public int hashCode() {        return Objects.hash(super.hashCode(), id, name);    }}